import React from "react";

const Panel = ({
  w,
  h,
  convex = false,
  concave = false,
  children,
  row = true,
}) => {
  return (
    <div
      className={`pnl-ctn`}
      style={{ flexBasis: `${w * 100}px`, height: `${h * 100}px` }}
    >
      <div
        className={`pnl ${convex ? "convex" : concave ? "concave" : ""} ${
          row ? "flx-row" : "flx-clmn"
        }`}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
